import { Routes, Route } from "react-router-dom";
import Home from "./components/Home";
import Movies from "./components/movieMenu/Movies";
import NavBar from "./components/NavBar";
import TvShows from "./components/tvMenu/TvShows";
import Actors from "./components/actors/Actors";
import MoviesDetails from "./components/movieMenu/MoviesDetails";
import FullCast from "./components/movieMenu/FullCast";
import Reviews from "./components/movieMenu/Reviews";
import TvDetails from "./components/tvMenu/TvDetails";

function App() {
  return (
    <div>
      <NavBar />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/movie" element={<Movies />} />
        <Route path="/tvshows" element={<TvShows />} />
        <Route path="/actors" element={<Actors />} />
        <Route path="/movie/:id" element={<MoviesDetails />} />
        <Route path="/movie/:id/cast" element={<FullCast />} />
        <Route path="/movie/:id/review" element={<Reviews />} />
        <Route path="/tvshows/:id" element={<TvDetails />} />
      </Routes>
    </div>
  );
}

export default App;
